#import "TISSingleTextAreaVC.h"
#import "TISHeader.h"

@interface TISSingleTextAreaVC ()
@property (nonatomic, strong) TISTextArea *tisTextAreaTitle;
@end

@implementation TISSingleTextAreaVC

- (void)viewDidLoad {
    [super viewDidLoad];
    
    self.title = @"标题区域";
    self.view.backgroundColor = [UIColor whiteColor];
    
    // 设置导航栏视图
    [self setNavgationView];
    
    // 设置页面显示视图
    [self setUpView];
    
}

// 设置导航栏视图
- (void)setNavgationView {
    UIButton *sureButton = [UIButton buttonWithType:UIButtonTypeSystem];
    sureButton.titleLabel.font = [UIFont systemFontOfSize:14];
    sureButton.frame = CGRectMake(0, 0, 40, 40);
    [sureButton setTitle:@"确定" forState:UIControlStateNormal];
    [sureButton addTarget:self action:@selector(sureButtonClicked) forControlEvents:UIControlEventTouchUpInside];
    UIBarButtonItem *item = [[UIBarButtonItem alloc] initWithCustomView:sureButton];
    self.navigationItem.rightBarButtonItem = item;
}

// 确定按钮点击事件
- (void)sureButtonClicked {
    [self.tisTextAreaTitle cancelFirstResponder];
}

// 设置页面显示视图
- (void)setUpView {
    self.tisTextAreaTitle = [[TISTextArea alloc] initWithFrame:CGRectMake(20, TIS_NAV_HEIGHT, TIS_Screen_Width - 40, TIS_Screen_Height - TIS_NAV_HEIGHT - 24)];
    self.tisTextAreaTitle.backgroundColor = [UIColor whiteColor];
    self.tisTextAreaTitle.textAreaSpace = 8;
    self.tisTextAreaTitle.limitCount = 1200;
