- (void)keyboardWillShow:(NSNotification *)notification {
    CGRect keyboardFrame = [notification.userInfo[@"UIKeyboardFrameEndUserInfoKey"] CGRectValue];
    self.tisTextAreaTitle.frame = CGRectMake(20, TIS_NAV_HEIGHT, TIS_Screen_Width - 40, TIS_Screen_Height - keyboardFrame.size.height - TIS_NAV_HEIGHT);
    [self.tisTextAreaTitle updateSubFrame];
}

- (void)keyboardWillHide:(NSNotification *)notification {
    self.tisTextAreaTitle.frame = CGRectMake(20, TIS_NAV_HEIGHT, TIS_Screen_Width - 40, TIS_Screen_Height - TIS_NAV_HEIGHT - 24);
    [self.tisTextAreaTitle updateSubFrame];
}

